LIDAD EN EL SERVICIO DE LOS DERECHOHABIENTES.',1,3,2,2021),(21,'2.19.8.3.2.2. REFORZAR A TRAVÉS DE MECANISMOS ADMINISTRATIVOS Y/O OPERATIVOS EL SISTEMA DE REFERENCIA Y CONTRA REFERENCIA DEL ISSET.',1,3,2,2021),(22,'2.19.8.3.2.3. BRINDAR ATENCIÓN DOMICILIARIA A LOS DERECHOHABIENTES PARA CONSOLIDAR LA MEDICINA PREVENTIVA, MEDIANTE EL PROGRAMA ISSET EN TU CASA.',1,3,2,2021),(23,'2.19.8.3.2.4. OTORGAR ATENCIÓN MÉDICA PRIORITARIA AL TRABAJADOR, A TRAVÉS DEL PROGRAMA DE ATENCIÓN INTEGRAL AL TRABAJADOR (PAIT).',1,3,2,2021),(24,'2.19.8.3.2.5. ENTREGAR CON OPORTUNIDAD, CALIDAD Y CALIDEZ, LOS MEDICAMENTOS MEDIANTE EL PROGRAMA FARMAISSET.',1,3,2,2021),(25,'2.19.8.4.1.1. CONSTRUIR UN NUEVO HOSPITAL DE ESPECIALIDADES MÉDICAS PARA LOS DERECHOHABIENTES DEL ISSET.',1,4,2,2021);
