INSERT INTO `programas_presupuestarios` VALUES (1,'E058','Prestaciones médicas para la seguridad social.','Contempla el financiamiento de todos los servicios médicos que brinda el ISSET, incluyendo los programas sustantivos, los servicios auxiliares de diagnóstico, los auxiliares de tratamiento, los servicios personales, los servicios generales, la actualización y enseñanza del personal que interviene en la prestación de tales servicios','La población derechohabiente del ISSET accede a servicios médicos.',1,1,NULL),(2,'E059','Prestaciones sociales para los servidores públicos.','Considera el gasto que destina el ISSET, para prestar los servicios sociales, cultura, deporte y recreación, que la legislación otorga a los trabajadores del Estado, incluso el gasto en servicios personales, servicios generales y la dotación de material de apoyo administrativo.','Los derechohabientes del ISSET son beneficiados con las prestaciones sociales.',1,1,NULL),(3,'J001','Prestaciones económicas para los servidores públicos.','Incluye el gasto que el ISSET destina al pago de créditos, seguros y pensiones establecidos en la Ley de Seguridad Social del Estado de Tabasco, a favor de la población derechohabiente, así como la operación del programa.','Los derechohabientes del ISSET son beneficiados con las prestaciones económicas',1,1,NULL),(4,'K013','Tecnologías de la información y comunicación.','Modernizar la gestión administrativa y operativa de las unidades administrattivas y médicas con equipamiento tecnológico y procesos tecnológicos que permitan incrementar la calidad de los servicios.','',1,1,NULL),(5,'K015','Equipamiento para la gestión pública','Adquisición de mobiliario para las áreas administrativas','Adquisición de mobiliario para las áreas administrativas',1,1,NULL),(6,'K024','Equipamiento médico para la seguridad social.','Incluye el gasto para adquirir equipo, mobiliario e instrumental para la atención médica, así como para los servicios auxiliares de diagnóstico y para auxiliares de tratamiento en las unidades de atención médica del ISSET y el mantenimiento preventivo y correctivo.','Los  201 mil 498 derechohabientes del ISSET reciben una atención médica adecuada',1,1,NULL),(7,'K025','Infraestructura para la seguridad social.','Incluye las asignaciones presupuestales para crear, adecuar y mantener inmuebles que se inscriben en el patrimonio del ISSET.','Los servicios del ISSET se brindan en instalaciones adecuadas.',1,1,NULL),(8,'P022','Gestión para la seguridad social.','Contempla el presupuesto destinado a financiar las tareas de apoyo administrativo, el gasto de nómina, de equipamiento, la provisión de servicios generales e insumos para cumplir con dichas tareas. Incluye el equipamiento y los servicios generales para las prestaciones socioeconómicas.','',1,1,NULL);
/*!40000 ALTER TABLE `programas_presupuestarios` ENABLE KEYS */;
UNLOCK TABLES;

